import Navbar from "./Navbar";
import Hero from "./Hero";
import HeroMain from "./HeroMain";
import Keynotes from "./Keynotes";
import Footer from "./Footer";


function Home() {
  return (
    <><Navbar /><HeroMain /><Hero /><Keynotes /><Footer /></>
  )
}

export default Home
